# This function takes in a year, month, and day as arguments and returns the day of the week as an integer (0-6)
def calc_day_in_a_week(year,month,day):
    List=[0,3,3,6,1,4,6,2,5,0,3,5]
    key=(year-2000)+(year-2000)//4+day+List[month-1]+6
    if((((year%4==0 and year%100!=0) or year%400==0))and(month==0 or month ==1)):
        key=key-1
    return key%7

