# This function takes in several arguments such as population, population growth, average wage, people per household, workers per household, and date and returns the total demand for houses
def houses_demand(population, population_growth, average_wage, people_per_household,workers_per_household, date):
    updated_population = population * math.pow(population_growth,date[0]-2021)
    households = updated_population/people_per_household
    income_factor = income_quintile_payments[max([i for i in income_quintile_payments.keys() if i<workers_per_household*average_wage])]
    total_demand= math.pow(households_demands_growth,date[0]-2021)*households*income_factor*demand_for_month_in_2021[date[1]]
    return total_demand

# This function takes in several arguments such as amount, amount growth, demand growth, demand, and date and returns the demand for hotels
def hotel_demand(amount,amount_growth,demand_growth,demand,date):
    return amount*math.pow(amount_growth,date[0]-2021)*hotel_demand_for_month_factor[date[1]]\
           *math.pow(demand_growth,date[0]-2021)*demand

# This function takes in several arguments such as amount, amount growth, demand growth, demand, and date and returns the demand for businesses
def businesses_demand(amount,amount_growth,demand,date,demand_growth):
    return amount * demand * math.pow(amount_growth*demand_growth, date[0] - 2021)
# This function takes in several arguments such as amount, amount growth, demand growth, demand, and date and returns the demand for businesses
def restaurants_demand(amount,amount_growth,demand,date,demand_growth):
    return amount * demand * math.pow(amount_growth*demand_growth, date[0] - 2021)
# This function takes in several arguments such as amount, amount growth, demand growth, demand, and date and returns the demand for factories
def factories_demand(amount,amount_growth,demand,date,demand_growth=1.034):
    return amount * demand * math.pow(amount_growth*demand_growth, date[0] - 2021)
# This function takes in several arguments such as amount, amount growth, demand growth, demand, and date and returns the demand for industries
def industry_demand(amount,amount_growth,demand,date,demand_growth=1.034):
    return amount * demand * math.pow(amount_growth*demand_growth, date[0] - 2021)

# This function takes in several arguments such as population at 2021, population growth, average wage, people per household, workers per household and returns a dictionary containing the household demands for each year from 2021 to 2050
def households_demands_table(population_at_2021, population_growth, average_wage, people_per_household,
                             workers_per_household):
    # Initialize an empty dictionary to store the household demands for each year
    Dict = {}

    # Set the initial population to the population at 2021
    population = population_at_2021

    # Calculate the income factor based on the average wage and workers per household
    income_factor = income_quintile_payments[
        max([i for i in income_quintile_payments.keys() if i < workers_per_household * average_wage])]

    # Loop through each year from 2021 to 2050
    for year in range(2017, 2051):
        # Calculate the number of households based on the population and people per household
        households = population / people_per_household

        # Initialize an empty list to store the monthly demands for this year
        yearly_list = []

        # Loop through each month
        for month in range(12):
            # Calculate the monthly demand based on the household demands growth rate, number of households, income factor, and demand for this month in 2021
            monthly_demand = math.pow(households_demands_growth, year - 2021) * households * income_factor * \
                             demand_for_month_in_2021[month]

            # Get the number of days in this month
            days_in_the_month = days_in_a_month[month]

            # If this is a leap year and the current month is February, add one day to the number of days in this month
            if (year % 4 == 0 and month == 1):
                days_in_the_month = days_in_the_month + 1

            # Calculate the daily basic demand by dividing the monthly demand by the number of days in this month
            daily_basic = monthly_demand / days_in_a_month[month]

            # Initialize an empty list to store the daily demands for this month
            monthly_list = []

            # Loop through each day in this month
            for day in range(days_in_the_month):
                # Calculate the daily demand based on the daily basic demand and day in a week factor
                daily_demand = daily_basic * day_in_a_week_factor[calc_day_in_a_week(year, month + 1, day + 1)]

