def total_demand_table(population_at_2021, population_growth, average_wage, people_per_household, workers_per_household,
                       hotels_amount,hotels_amount_growth,hotels_demand_growth,hotels_demand,
                       businesses_amount,businesses_amount_growth,businesses_demand_growth,businesses_demand,
                       restaurants_amount,restaurants_amount_growth,restaurants_demand_growth,restaurants_demand,
                       factories_amount,factories_amount_growth,factories_demand_growth,factories_demand,
                       industry_amount,industry_amount_growth,industry_demand_growth,industry_demand):
    # Calculate the household demands for each year from 2021 to 2050 using the households_demands_table function
    HHD = households_demands_table(population_at_2021, population_growth, average_wage, people_per_household,
                                   workers_per_household)

    # Calculate the hotel demands for each year from 2021 to 2050 using the hotels_demands_table function
    HD = hotels_demands_table(hotels_amount, hotels_amount_growth, hotels_demand_growth, hotels_demand)

    # Calculate the business demands for each year from 2021 to 2050 using the businesses_demands_table function
    BD = businesses_demands_table(businesses_amount, businesses_amount_growth, businesses_demand_growth,
                                  businesses_demand)
    RD = restaurants_demands_table(restaurants_amount,restaurants_amount_growth,restaurants_demand_growth,restaurants_demand)
    # Calculate the factory demands for each year from 2021 to 2050 using the factories_demands_table function
    FD = factories_demands_table(factories_amount, factories_amount_growth, factories_demand_growth, factories_demand)

    # Calculate the industry demands for each year from 2021 to 2050 using the industry_demands_table function
    ID = industry_demands_table(industry_amount, industry_amount_growth, industry_demand_growth, industry_demand)

    # Initialize an empty dictionary to store the total demands for each year
    Total_demands_dict = {}

    # Loop through each year from 2021 to 2050
    for year in range(2017, 2051):
        # Initialize an empty list to store the monthly demands for this year
        yearly_list = []

        # Loop through each month
        for month in range(0, 12):
            # Get the number of days in this month
            days_in_the_month = days_in_a_month[month]

            # If this is a leap year and the current month is February, add one day to the number of days in this month
            if (year % 4 == 0 and month == 1):
                days_in_the_month = days_in_the_month + 1

            # Initialize an empty list to store the daily demands for this month
            monthly_list = []

            # Loop through each day in this month
            for day in range(days_in_the_month):
                # Initialize an empty list to store the hourly demands for this day
                daily_list = []

                # Loop through each hour in this day
                for hour in range(24):
                    # Calculate the total hourly demand by adding up the hourly demands for households, hotels, businesses, factories, and industries
                    daily_list.append(HHD[year][month][day][hour] +
                                      HD[year][month][day][hour] +
                                      BD[year][month][day][hour] +
                                      RD[year][month][day][hour] +
                                      FD[year][month][day][hour] +
                                      ID[year][month][day][hour])

                # Append the list of hourly demands for this day to the list of daily demands for this month
                monthly_list.append(daily_list)

            # Append the list of daily demands for this month to the list of monthly demands for this year
            yearly_list.append(monthly_list)

        # Add an entry to the dictionary mapping this year to the list of monthly demands for this year
        Total_demands_dict[year] = yearly_list

    # Return the dictionary containing the total demands for each year from 2021 to 2050
    return Total_demands_dict
def datetostr(year,month,day):
    if (9 < day):
        daystr = str(day)
    else:
        daystr = "0" + str(day)
    if (9 < month):
        monthstr = str(month)
    else:
        monthstr = "0" + str(month)
    return daystr+"/"+monthstr+"/"+str(year)
